import React, { useState } from "react";
import "./searchCriteria.css";

const SearchCriteria = () => {
  return (
    <div>
      <h2>Neighborhood</h2>
      <label class="container">
        One
        <input type="checkbox" />
        <span class="checkmark"></span>
      </label>
      <label class="container">
        Two
        <input type="checkbox" />
        <span class="checkmark"></span>
      </label>
      <label class="container">
        Three
        <input type="checkbox" />
        <span class="checkmark"></span>
      </label>
      <label class="container">
        Four
        <input type="checkbox" />
        <span class="checkmark"></span>
      </label>
    </div>
  );
};

export default SearchCriteria;
